import React from 'react';
import headerLogo from '../images/logo_white.svg'
import { Link, Route, Routes } from 'react-router-dom';




function Header() {
  return (
    <header className="header">
      <img className="logo" src={headerLogo} alt="Логотип" />
      <Routes>
        <Route path="/" element={<button onClick={logout}><Link className='header__link' to="/sign-up">Выйти</Link></button>
        } />
        <Route path="/sign-up" element={<Link className='header__link' to="/sign-in">Регистрация</Link>} />
        <Route path="/sign-in" element={<Link className='header__link' to="/sign-up">Войти</Link>} />
      </Routes>
    </header>
  );
}



export default Header;
